      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

contract Fee {
    address public owner;
        error Unauthorized();


    modifier onlyOwner() virtual {
        if (msg.sender != owner) revert Unauthorized();

        _;
    }

    constructor(
        address _owner
    ) {
        owner = _owner;
    }


    uint16 public _MarketFee;  

    event SetMarketFee(uint16 newFee, uint16 oldFee);
    event SetNewOwner(address newOwner, address oldOwner);

    function MarketFee() public view returns (uint16) {
        return _MarketFee;
    }


    function getOwnerAddress() public view returns (address) {
        return owner;
    }

    function setOwnerAddress(address _newOwner) public onlyOwner {
        if (_newOwner == owner) return;

        address oldOwner = owner;
        owner = _newOwner;
        emit SetNewOwner(_newOwner, oldOwner);
    }

    function setMarketFee(uint16 newFee) public onlyOwner {
        if (newFee == _MarketFee) return;

        uint16 oldFee = _MarketFee;
        _MarketFee = newFee;
        emit SetMarketFee(newFee, oldFee);
    }

}
